const $ = new Env('Pear视频解析');
const WORKER_URL = 'https://pear.zzxu.de';

// 用户配置 (qx用户支持boxjs)
let USER_CONFIG = {
    PLAYER_Code: "lenna",    // 默认播放器
    CustomScheme: "",        // 自定义 Scheme
    UrlEncode: ""            // 是否URL编码: "yes"/"no"/""(自动)
};

// BoxJS键
const BOXJS_KEYS = {
    player: "pear_player_select",
    scheme: "pear_custom_scheme",
    encode: "pear_url_encode"
};

// 播放器表
const PLAYER_MAP = {
    "lenna": { scheme: "lenna://x-callback-url/play?url=", needEncode: true, supportName: false },
    "SenPlayer": { scheme: "SenPlayer://x-callback-url/play?url=", needEncode: true, supportName: false },
    "SenPlayer-dl": { scheme: "SenPlayer://x-callback-url/download?url=", needEncode: true, supportName: true },
    "Infuse": { scheme: "infuse://x-callback-url/play?url=", needEncode: true, supportName: false },
    "Fileball": { scheme: "filebox://play?url=", needEncode: true, supportName: false },
    "Alook": { scheme: "Alook://", needEncode: false, supportName: false },
    "VLC": { scheme: "vlc://", needEncode: false, supportName: false },
    "KMPlayer": { scheme: "kmplayer://", needEncode: false, supportName: false },
    "VidHub": { scheme: "vidhub://x-callback-url/play?url=", needEncode: true, supportName: false },
    "IINA": { scheme: "iina://weblink?url=", needEncode: true, supportName: false },
    "NPlayer": { scheme: "nplayer-http://", needEncode: false, supportName: false },
    "Safari": { scheme: "http://", needEncode: false, supportName: false }
};

// 读BoxJS
function loadBoxJSConfig() {
    const playerSelect = $.getdata(BOXJS_KEYS.player);
    const customScheme = $.getdata(BOXJS_KEYS.scheme);
    const urlEncode = $.getdata(BOXJS_KEYS.encode);
    
    if (playerSelect === "custom" && customScheme) {
        USER_CONFIG.CustomScheme = customScheme;
    } else if (playerSelect && playerSelect !== "custom") {
        USER_CONFIG.PLAYER_Code = playerSelect;
    }
    
    if (urlEncode) USER_CONFIG.UrlEncode = urlEncode;
}

// 解析参数
function parseArgs() {
    if (typeof $argument === "undefined" || !$argument) return;
    
    let args = $argument;
    
    // Loon格式
    if (typeof args === 'string' && args.startsWith('[') && args.endsWith(']')) {
        const inner = args.slice(1, -1);
        const parts = inner.split(',').map(s => s.trim());
        if (parts[0]) USER_CONFIG.PLAYER_Code = parts[0];
        if (parts[1]) USER_CONFIG.CustomScheme = parts[1];
        if (parts[2]) USER_CONFIG.UrlEncode = parts[2];
        return;
    }
    
    // Surge格式
    const params = Object.fromEntries(new URLSearchParams(args));
    if (params.player) USER_CONFIG.PLAYER_Code = decodeURIComponent(params.player);
    if (params.scheme) USER_CONFIG.CustomScheme = decodeURIComponent(params.scheme);
    if (params.encode) USER_CONFIG.UrlEncode = decodeURIComponent(params.encode);
}

// 获取Scheme
function getFinalScheme() {
    const scheme = USER_CONFIG.CustomScheme;
    if (scheme && scheme.length > 5 && scheme !== "none" && !scheme.includes("{") && !scheme.includes("完整的") && !scheme.includes("URLscheme")) {
        return { scheme: scheme, needEncode: true, supportName: false };
    }
    
    let input = USER_CONFIG.PLAYER_Code || "lenna";
    
    if (input.includes("{") || input.includes("}")) {
        input = "lenna";
        USER_CONFIG.PLAYER_Code = "lenna";
    }
    
    const key = Object.keys(PLAYER_MAP).find(k => k.toLowerCase() === input.toLowerCase());
    return key ? PLAYER_MAP[key] : PLAYER_MAP["lenna"];
}

// 构建URL
function buildPlayerUrl(videoUrl, videoName = '') {
    const player = getFinalScheme();
    const schemePrefix = player.scheme;
    
    if (schemePrefix.startsWith("http")) {
        return videoUrl;
    }
    
    const prefix = (schemePrefix.endsWith("=") || schemePrefix.endsWith("://")) ? schemePrefix : `${schemePrefix}://`;
    
    let needEncode = player.needEncode;
    const encodeConfig = USER_CONFIG.UrlEncode.toLowerCase();
    if (encodeConfig === "yes" || encodeConfig === "1" || encodeConfig === "true") {
        needEncode = true;
    } else if (encodeConfig === "no" || encodeConfig === "0" || encodeConfig === "false") {
        needEncode = false;
    }
    
    let finalUrl = needEncode ? (prefix + encodeURIComponent(videoUrl)) : (prefix + videoUrl);
    
    // SenPlayer命名处理
    if (player.supportName && videoName) {
        let cleanName = videoName.replace(/[<>:"/\\|?*]/g, '').trim();
        if (!cleanName.toLowerCase().endsWith('.mp4')) {
            cleanName = cleanName.replace(/\.[^.]+$/, '') + '.mp4';
        }
        
        const separator = finalUrl.includes('?') ? '&' : '?';
        finalUrl += separator + 'name=' + encodeURIComponent(cleanName);
    }
    
    return finalUrl;
}

// 缓存键
const CACHE_KEY = 'pear_last_video_id';

// 检查通知
function shouldNotify(videoId) {
    const lastId = $.getdata(CACHE_KEY);
    if (lastId === videoId) {
        return false;
    }
    $.setdata(videoId, CACHE_KEY);
    return true;
}

// 初始化
loadBoxJSConfig();
parseArgs();


